sys_variable_value.value:
(function execute(inputs, outputs) {

  var orderLinesArr = [];
  for(var i=0;i<inputs.orderLines.length;i++){
    objLine=inputs.orderLines[i];

    var line = {
    unitPrice:objLine.unit_price,
    manufacturerPartId:'',
    quantity:parseInt(objLine.quantity),
    cdwPartNumber:objLine.cdw_part_number,
    manufacturerName:objLine.manufacturer_name,
    requestDeliverydate:objLine.requested_delivery_date,
    uom:'EA',
    contractId:'',
    unspscCode:'',
    itemDescription:objLine.item_description,
    lineNumber:objLine.line_number,
    couponCode:''
  };
    orderLinesArr.push(line);
  }
  outputs.orderlines=JSON.stringify(orderLinesArr);
})(inputs, outputs);

